import { func } from "prop-types";
import React, { useState } from "react";
import {Routes, Route, Link, useNavigate} from 'react-router-dom';
import ApartmentForm from "./ApartmentForm";
import ApartmentDetail from "./ApartmentDetail";
import './main.css';
import './list.css';
import table from "./table";

const colname = 
[
  {width: "12%", title: "Mã căn hộ"},
  {width: "12%", title: "Tên căn hộ"},
  {width: "12%", title: "Số phòng"},
  {width: "12%", title: "Diện tích"},
  {width: "22%", title: "Địa chỉ"},
  {width: "12%", title: "Chi tiết"},
  {width: "12%", title: "Cập nhật / Xoá"}
]
const tbcontent = [
[
  "AP-001",
  "A.112",
  "3",
  "98m2",
  "Quận 1",
  <Link to='/BuildingDetail'>Xem chi tiết</Link>,
  <><img alt="edit4140" src="/icon/edit-icon.svg" className="edit-icon" />
    <img alt="trashalt4140" src="/icon/delete-icon.svg" className="trash-icon" /></>
],
[
  "AP-001",
  "A.112",
  "3",
  "98m2",
  "Quận 1",
  <Link to='/BuildingDetail'>Xem chi tiết</Link>,
  <><img alt="edit4140" src="/icon/edit-icon.svg" className="edit-icon" />
    <img alt="trashalt4140" src="/icon/delete-icon.svg" className="trash-icon" /></>
]]

function Main () {
  const navigate = useNavigate();
  const handleClick = (event) =>
  {
    event.preventDefault();
    navigate('/ApartmentForm');
  }
  return(
    <div><span class="function-title textxlsemibold">Căn hộ</span>
    <div class="main-zone">
      <div class="main-head">
        <div class="search-list">
          <input
            type="text"
            placeholder="Tìm kiếm"
            className="searchbar"
          />
          <img
            src="/icon/search-icon.svg"
            className="search-icon"
          /> 
        </div>
        <button class="addbutton" onClick={handleClick}>
          <span class="addbutton-text textsmsemibold">Thêm căn hộ</span>
          <img
            src="./icon/add-icon.svg"
            class="pluscircle" />
        </button>
      </div>
      <div className="table-area">
        {table(colname, tbcontent)}
      </div>
    </div></div>
  )
}

export default function ApartmentList ()
{
  return(
    <Routes>
      <Route path="/" element={<Main />} />
      <Route path="/ApartmentForm" element={<ApartmentForm />} />
      <Route path="/ApartmentDetail" element={<ApartmentDetail />} />
    </Routes>
  )
}
